<script>
// Starry background animation
const canvas = document.getElementById('starfield');
const ctx = canvas.getContext('2d');
let stars = [];
const starCount = 300;
function resize() {
  canvas.width = window.innerWidth;
  canvas.height = window.innerHeight;
}
class Star {
  constructor() {
    this.x = Math.random() * canvas.width;
    this.y = Math.random() * canvas.height;
    this.radius = Math.random() * 1.3 + 0.3;
    this.alpha = Math.random() * 0.7 + 0.3;
    this.delta = (Math.random() * 0.02 + 0.005) * (Math.random() < 0.5 ? 1 : -1);
  }
  draw() {
    ctx.beginPath();
    ctx.arc(this.x, this.y, this.radius, 0, Math.PI * 2);
    ctx.fillStyle = `rgba(255,255,255,${this.alpha})`;
    ctx.fill();
  }
  update() {
    this.alpha += this.delta;
    if(this.alpha < 0.2 || this.alpha > 1) this.delta = -this.delta;
  }
}
function initStars() {
  stars = [];
  for(let i=0; i<starCount; i++) stars.push(new Star());
}
function animateStars() {
  ctx.clearRect(0, 0, canvas.width, canvas.height);
  stars.forEach(s => { s.update(); s.draw(); });
  requestAnimationFrame(animateStars);
}
window.addEventListener('resize', () => { resize(); initStars(); });
resize(); initStars();
animateStars();

// CSV parsing helper
function parseCSV(text) {
  const lines = text.trim().split('\n');
  const headers = lines[0].split(',');
  const rows = lines.slice(1).map(line => line.split(','));
  return { headers, rows };
}

// Build table
const table = document.getElementById('habitTable');
const { headers, rows } = parseCSV(csvData);
const tbody = table.querySelector('tbody');

// Add habit headers
const theadRow = table.querySelector('thead tr');
headers.slice(1).forEach(habit => { // skip Date col
  const th = document.createElement('th');
  th.textContent = habit;
  theadRow.appendChild(th);
});

// Add rows & data
rows.forEach(row => {
  const tr = document.createElement('tr');
  const dateCell = document.createElement('td');
  dateCell.textContent = row[0];
  dateCell.className = 'date';
  tr.appendChild(dateCell);

  for(let i=1; i < row.length; i++) {
    const val = parseInt(row[i]);
    const td = document.createElement('td');
    if(val === 2){
      td.classList.add('done');
      td.textContent = 'âœ”'; // tick
      td.title = "Done";
    } else {
      td.classList.add('notdone');
      td.textContent = 'â—‹'; // circle
      td.title = "Not Done";
    }
    tr.appendChild(td);
  }
  tbody.appendChild(tr);
});
